import { Box } from "@mui/system";
import React, { useState } from "react";



function Home(){

    const [item , setItem] = useState([{
        name : '상품1',
        price : '13000원',
    },
    {
        name : '상품2',
        price : '23000원',
    },
    {
        name : '상품3',
        price : '33000원',
    },
    {
        name : '상품4',
        price : '43000원',
    },
    {
        name : '상품5',
        price : '53000원',
    },
    {
        name : '상품6',
        price : '63000원',
    },
    {
        name : '상품7',
        price : '63000원',
    },
]);

    return(
        <Box>
            <Box component="img" src="img/test.png" width="30%" height="30%" sx={{m:'0 auto'}}></Box>
        <Grid container >
            <Grid item>

            </Grid>
        </Grid>
        </Box>
    );
}

export default Home;
